import React from 'react';
import MenuItems from './MenuItems'; // Adjust the import path based on your project structure

const MenuPage = () => {
  // Sample menu data
  const menuItems = [
    { id: 1, name: 'Burger', price: 9.99 },
    { id: 2, name: 'Pizza', price: 12.99 },
    { id: 3, name: 'Salad', price: 7.99 },
    // Add more menu items as needed
  ];

  return (
    <div className="menu-page">
      <h1>Menu</h1>
      <div className="menu-list">
        {menuItems.map((item) => (
          <MenuItem key={item.id} name={item.name} price={item.price} />
        ))}
      </div>
    </div>
  );
};

export default MenuPage;
